import { container } from '@mui/system';

function HomePage() {
    return (
      <body>
        <main>
          <Container>
            <h1>Welcome to my app!</h1>
            <p>This is the home page.</p>
          </Container>
        </main>        
      </body>
    );
  }
  
  export default HomePage;
